import react, { Component } from 'react';
import Layout from './hoc/Layout/Layout'
import { Route, Swich } from 'react-router-dom';
import Quiz from './Containers/Quiz/Quiz';

class App extends Component {
  render() {
    return (
      <div className="App" >
        <Layout>
          <Swich>
            <Route path='/auth' element={<Quiz />} />
            <Route path='/quiz-creator' element={<App />} />
            <Route path='/quis:id' element={<App />} />
            <Route path='/quis' element={<App />} />
          </Swich>

        </Layout>

      </div>
    );
  }
}

export default App;
